--Crearem l'usuari cadastre

CREATE USER cadastre IDENTIFIED BY cadastre
      DEFAULT TABLESPACE system
      TEMPORARY TABLESPACE temp
      QUOTA UNLIMITED ON users;
      
-- Assignem permisos i rols.

GRANT CREATE session TO cadastre;
GRANT CREATE table TO cadastre;
GRANT CREATE view TO cadastre;
GRANT CREATE procedure TO cadastre;
GRANT CREATE synonym TO cadastre;
grant CONNECT, RESOURCE to cadastre;
grant UNLIMITED TABLESPACE to cadastre;


-- Inicialment s'esborren totes les taules
DROP TABLE HabitaPis;
DROP TABLE CasaParticular;
DROP TABLE Pis;
DROP TABLE Persona;
DROP TABLE BlocCases;
DROP TABLE Vivenda;
DROP TABLE ZonaUrbana;

-- Crear les taules

CREATE TABLE ZonaUrbana (
 nom_zona VARCHAR2(60) NOT NULL,
 	CONSTRAINT pk_zon PRIMARY KEY (nom_zona),
	CONSTRAINT ck_zon CHECK (nom_zona = upper(nom_zona)));

 CREATE TABLE Vivenda (
 carrer VARCHAR2 (80) NOT NULL,
 nombre NUMBER (4) NOT NULL,
 tipus_vivenda VARCHAR2 (1),
 codi_postal NUMBER(5),
 metres NUMBER(5),
 nom_zona VARCHAR2(60),
	CONSTRAINT pk_viv PRIMARY KEY (carrer, nombre),
	CONSTRAINT ck_cal CHECK (carrer=INITCAP(carrer)),
	CONSTRAINT ck_nom CHECK (nombre >= 0),
	CONSTRAINT ck_tv CHECK (tipus_vivenda IN ('C', 'B')),
	CONSTRAINT fk_viv_zon FOREIGN KEY (nom_zona) REFERENCES ZonaUrbana(nom_zona));
	
CREATE TABLE Persona (
 dni VARCHAR2(12) NOT NULL, 
 nom_persona VARCHAR2(20) NOT NULL,
 cognoms_persona VARCHAR2(40) NOT NULL,
 dni_c VARCHAR2(12),
 carrer VARCHAR2(80),
 nombre NUMBER (4) NOT NULL,
	CONSTRAINT pk_per PRIMARY KEY (dni),
	CONSTRAINT fk_per_viv FOREIGN KEY (carrer, nombre) REFERENCES Vivenda(carrer, nombre),
	CONSTRAINT fk_per_per FOREIGN KEY (dni_c) REFERENCES Persona(dni));
 
CREATE TABLE BlocCases (
 carrer VARCHAR2(80) NOT NULL,
 nombre NUMBER (4) NOT NULL,
 metres_b NUMBER (4),
 	CONSTRAINT pk_blo PRIMARY KEY (carrer, nombre),
	CONSTRAINT fk_blo_viv FOREIGN KEY (carrer, nombre) REFERENCES Vivenda(carrer, nombre) ON DELETE CASCADE,
	CONSTRAINT ck_mb CHECK (metres_b > 0));

CREATE TABLE CasaParticular (
 carrer VARCHAR2(80) NOT NULL,
 nombre NUMBER (4) NOT NULL,
 metres_c NUMBER (4),
 dni_cp  VARCHAR2(12) ,
	CONSTRAINT pk_cas PRIMARY KEY (carrer, nombre),
	CONSTRAINT fk_cas_per FOREIGN KEY (dni_cp) REFERENCES Persona(dni),
	CONSTRAINT fk_cas_viv FOREIGN KEY (carrer, nombre) REFERENCES Vivenda(carrer, nombre) ON DELETE CASCADE,
	CONSTRAINT ck_mt CHECK (metres_c > 0));
 
 CREATE TABLE Pis (
 carrer VARCHAR2(80) NOT NULL,
 nombre NUMBER (4) NOT NULL,
 escala VARCHAR2 (1) NOT NULL,
 planta NUMBER(2) NOT NULL,
 porta VARCHAR2(2) NOT NULL,
 metres_p NUMBER (4),
 dni_p  VARCHAR2(12),
	CONSTRAINT pk_pis PRIMARY KEY (carrer, nombre, escala, planta, porta),
	CONSTRAINT ck_mep CHECK (metres_p > 0),
	CONSTRAINT fk_pis_blo FOREIGN KEY (carrer, nombre) REFERENCES BlocCases(carrer, nombre) ON DELETE CASCADE,
	CONSTRAINT fk_pis_per  FOREIGN KEY (dni_p) REFERENCES Persona(dni) ON DELETE CASCADE );
 
 CREATE TABLE HabitaPis (
 dni VARCHAR2(12) NOT NULL,
 carrer VARCHAR2(80) NOT NULL,
 nombre NUMBER (4) NOT NULL,
 escala VARCHAR2 (1) NOT NULL,
 planta NUMBER(2) NOT NULL,
 porta VARCHAR2(2) NOT NULL,
	CONSTRAINT pk_hap PRIMARY KEY (dni),
	CONSTRAINT fk_hap_cas FOREIGN KEY (carrer, nombre, escala, planta, porta) REFERENCES Pis(carrer, nombre, escala, planta, porta) ON DELETE CASCADE,
	CONSTRAINT fk_hbp_per  FOREIGN KEY (dni) REFERENCES Persona(dni));
	
